INSERT INTO `cauhois` (`id`, `name`, `noidung`, `mucdo`, `image`, `kienthuc_id`, `created_at`, `updated_at`) VALUES
(1, 'Cauhoi', 'Đồ thị a và b được hai học sinh vẽ khi làm thí nghiệm xác định liên hệ giữa cường độ dòng điện và hiệu điện thế đặt vào hai đầu dây dẫn. Nhận xét nào là đúng?', 0, '202312111439cau1.jpg', 1, '2023-12-11 07:39:56', '2023-12-11 07:39:56'),
(2, 'Cauhoi', 'Trên hình vẽ. Hãy cho biết đồ thị nào biểu diễn đúng mối quan hệ giữa cường độ dòng điện I(A) chạy trong dây dẫn và hiệu điện thế U(V) đặt vào hai đầu dây dẫn đó?', 0, '202312111440cau2.jpg', 1, '2023-12-11 07:40:37', '2023-12-11 07:40:37'),
(3, 'Cauhoi', 'Để đo cường độ dòng điện qua đèn, người ta mắc theo một trong bốn sơ đồ sau. Hãy cho biết sơ đồ nào ampe kế mắc đúng?', 0, '202312111441cau3.jpg', 1, '2023-12-11 07:41:24', '2023-12-11 07:41:24'),
(4, 'Cauhoi', 'Quan sát sơ đồ mạch điện. Phát biểu nào đúng', 0, '202312111442cau4.jpg', 1, '2023-12-11 07:42:14', '2023-12-11 07:42:14'),
(5, 'Cauhoi', ': Quan sát đồ thị sau, xác định cường độ dòng điện chạy qua dây dẫn khi hiệu điện thế là 4,5 V', 0, '202312111443cau5.png', 1, '2023-12-11 07:43:02', '2023-12-11 07:43:02'),
(6, 'Cauhoi', ': Một dây dẫn được mắc vào hiệu điện thế 8V thì cường độ dòng điện chạy qua nó là 0,4A. Quan sát bảng giá trị hiệu điện thế và cường độ dòng điện sau đây và cho biết giá trị nào của A, B, C, D là không phù hợp?', 1, '202312111444cau1.jpg', 1, '2023-12-11 07:44:43', '2023-12-11 07:44:43'),
(7, 'Cauhoi', ': Một dây dẫn được mắc vào hiệu điện thế 9V thì cường độ dòng điện chạy qua nó là 0,3A. Nếu giảm hiệu điện thế đặt vào hai đầu dây dẫn đi 3V thì dòng điện qua dây dẫn khi đó có cường độ như thế nào?', 1, NULL, 1, '2023-12-11 07:45:40', '2023-12-11 07:45:40'),
(8, 'Cauhoi', 'Dòng điện chạy qua một dây dẫn có cường độ 2,5A khi nó được mắc vào hiệu điện thế 50V. Muốn dòng điện chạy qua dây dẫn đó có cường độ dòng điện giảm đi 0,5A thì hiệu điện thế phải là bao nhiêu?', 1, NULL, 2, '2023-12-11 07:46:35', '2023-12-11 07:46:35'),
(9, 'Cauhoi', 'Khi đặt một hiệu điện thế 10V giữa hai đầu một dây dẫn thì dòng điện đi qua nó có cường độ là 1,25A. Hỏi phải giảm hiệu điện thế giữa hai đầu dây này đi một lượng là bao nhiêu để dòng điện đi qua dây chỉ còn là 0,75A?', 1, NULL, 2, '2023-12-11 07:47:25', '2023-12-11 07:47:25'),
(10, 'Cauhoi', 'Khi đặt vào hai đầu dây dẫn một hiệu điện thế 18V thì cường độ dòng điện chạy qua nó là 0,6 A. Nếu hiệu điện thế đặt vào hai đầu dây dẫn tăng lên đến 36V thì cường độ dòng điện chạy qua nó bằng bao nhiêu', 1, NULL, 2, '2023-12-11 07:48:11', '2023-12-11 07:48:11'),
(11, 'Cauhoi', 'Cường độ dòng điện đi qua một dây dẫn là I1, khi hiệu điện thế giữa hai đầu dây dẫn này là U1 = 7,2V. Dòng điện đi qua dây dẫn này sẽ có cường độ I2 lớn gấp bao nhiêu lần nếu hiệu điện thế giữa hai đầu của nó tăng thêm 10,8V?', 1, NULL, 2, '2023-12-11 07:48:58', '2023-12-11 07:48:58'),
(12, 'Cauhoi', 'Khi đặt hiệu điện thế 12V vào hai đầu một dây dẫn thì cường độ dòng điện chạy qua nó có cường độ 6 mA. Muốn dòng điện chạy qua dây dẫn đó có cường độ giảm đi 4 mA thì hiệu điện thế là:', 1, NULL, 2, '2023-12-11 07:50:01', '2023-12-11 07:50:01'),
(13, 'Cauhoi', 'Hiệu điện thế giữa hai đầu dây dẫn giảm bao nhiêu lần thì cường độ dòng điện chạy qua dây dẫn sẽ', 0, NULL, 2, '2023-12-11 07:50:43', '2023-12-11 07:50:43'),
(14, 'Cauhoi', 'Khi thay đổi hiệu điện thế giữa hai đầu dây dẫn thì cường độ dòng điện chạy qua dây dẫn đó có mối quan hệ', 0, NULL, 2, '2023-12-11 07:51:28', '2023-12-11 07:51:28'),
(15, 'Cauhoi', 'Khi thay đổi hiệu điện thế đặt vào hai đầu dây dẫn thì cường độ dòng điện giảm đi 3 lần. Hỏi hiệu điện thế ở hai đầu dây dẫn đã thay đổi thế nào?Chọn kết quả đúng trong các kết quả sau:', 0, NULL, 2, '2023-12-11 07:52:29', '2023-12-11 07:52:29'),
(16, 'Cauhoi', 'Hãy sắp đặt theo thứ tự đơn vị của các đại lượng sau: hiệu điện thế, cường độ dòng điện, điện trở.', 0, NULL, 4, '2023-12-11 07:53:38', '2023-12-11 07:53:38'),
(17, 'Cauhoi', 'Chọn phép đổi đơn vị đúng', 0, NULL, 4, '2023-12-11 07:54:26', '2023-12-11 07:54:26'),
(18, 'Cauhoi', 'Điều nào sau đây là đúng khi nói về điện trở của vật dẫn?', 0, NULL, 4, '2023-12-11 07:55:13', '2023-12-11 07:55:13'),
(19, 'Cauhoi', 'Điện trở R của dây dẫn biểu thị cho:', 0, NULL, 4, '2023-12-11 07:55:58', '2023-12-11 07:55:58'),
(20, 'Cauhoi', 'Đơn vị nào dưới dây là đơn vị đo điện trở?', 0, NULL, 4, '2023-12-11 07:56:35', '2023-12-11 07:56:35'),
(21, 'Cauhoi', 'Một bóng đèn khi sáng bình thường thì dòng điện qua nó là 0,2 A và hiệu điện thế là 3,6 V. Dùng bóng đèn trên với hiệu điện thế 6 V. Hiện tượng gì sẽ xảy ra?', 0, NULL, 5, '2023-12-11 07:57:21', '2023-12-11 07:57:21'),
(22, 'Cauhoi', 'Lựa chọn từ thích hợp điền vào chỗ trống. …………. của dây dẫn càng nhỏ thì dây dẫn đó dẫn điện càng tốt', 0, NULL, 5, '2023-12-11 07:58:10', '2023-12-11 07:58:10'),
(23, 'Cauhoi', 'Phát biểu nào sau đây là đúng', 0, NULL, 5, '2023-12-11 07:58:45', '2023-12-11 07:58:45'),
(24, 'Cauhoi', 'Điện trở của dây dẫn nhất định có mối quan hệ phụ thuộc nào dưới đây?', 0, NULL, 5, '2023-12-11 07:59:26', '2023-12-11 07:59:26'),
(25, 'Cauhoi', 'Cho điện trở R = 30Ω, hiệu điện thế đặt vào hai đầu điện trở là U, cường độ dòng điện chạy qua điện trở là I. Thông tin nào sau đây là đúng?', 0, NULL, 5, '2023-12-11 08:00:02', '2023-12-11 08:00:02'),
(26, 'Cauhoi', 'Trong các công thức sau đây, với U là hiệu điện thế giữa hai đầu dây dẫn, I là cường độ dòng điện qua dây dẫn, R là điện trở của dây dẫn, công thức nào là sai?', 0, NULL, 6, '2023-12-11 08:01:11', '2023-12-11 08:01:11'),
